import React from 'react';
import '../Styles/TaskForm.css';

function TaskForm(props){
  return(
    <form className='task-form'>
      <input
        className='task-input'
        type='text'
        placeholder='Write a task!'
        name='text'
      />
      <button className='task-button'>
        Add Task!
      </button>
    </form>

  );
}

export default TaskForm;
